const { Block } = require('../src/block')
const { Transaction } = require('../src/transaction')

block = ''

const parsedBlock = Block.parseRaw(block)
console.log(JSON.stringify(parsedBlock.transactions, null, 2))

const parsedMerkle = parsedBlock.header.merkle
const txids = parsedBlock.transactions.map(tx => tx.txid)
const calcMerkle = Block.calcMerkleRoot(txids)
console.log('parsed merkle', parsedMerkle)
console.log('calc merkle  ', calcMerkle)

console.log('merkle root is correct?', parsedMerkle == calcMerkle)

